        public unsafe static void MatrixMulti_Unsafe(double[,] result, double[,] a, double[,] b)
        {
            var ar = a.GetUpperBound(0);
            var ac = a.GetUpperBound(1);
            var bc = b.GetUpperBound(1);
            var arl = ar + 1;
            var acl = ac + 1;

            fixed (double* rp = result, ap = a, bp = b)
            {
                for (var i = 1; i <= ar; i++)
                {
                    for (var j = 1; j <= bc; j++)
                    {
                        for (var k = 1; k <= ac; k++)
                        {
                            *(rp + i * arl + j) += *(ap + i * arl + k) * *(bp + k * acl + j);
                        }
                    }
                }
            }
        }

